    true,nt"url": null,nt"notes": "China Administrative Regions GIS Data: 1:1M,
    County Level, 1 July 1990 consists of geographic boundary data for the administrative
    regions of China as of 1 July 1990. The data includes the geographical location,
    area, administrative division code, and county and island name. The data are at
    a scale of one to one million (1:1M) at the national, provincial, and county level.
    This dataset is produced in collaboration with the Columbia University Center for
    International Earth Science Information Network (CIESIN), Chinese Academy of Surveying
    and Mapping (CASM), and the University of Washington as part of the China in Time
    and Space (CITAS) project.",nt"license_title": "U.S. Government Work",nt"extras":
